import React from "react";
// import { NavLink } from "react-router-dom";
import { NavHashLink as NavLink } from "react-router-hash-link";
const CommonParent = (props) => {
  return (
    <section id="header">
      <div className="container-fluid d-flex align-items-center">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row">
              <div
                id="homeText"
                className="pt-lg-0 col-md-6 order-2 order-lg-1 d-flex justify-content-center flex-column"
              >
                {props.name}
                {props.text}

                <div className="mt-3 pt-4 order-3">
                  <NavLink smooth to={props.visit1} className="btn-get-started">
                    {props.btname1}
                  </NavLink>
                  <NavLink smooth to={props.visit2} className="btn-get-started">
                    {props.btname2}
                  </NavLink>
                </div>
              </div>

              {/* <div className="mt-3 order-3">
                <NavLink smooth to={props.visit1} className="btn-get-started">
                  {props.btname1}
                </NavLink>

                <NavLink smooth to={props.visit2} className="btn-get-started">
                  {props.btname2}
                </NavLink>
              </div> */}
              <div className="col-lg-6 order-1 order-lg-2 header-img ">
                <img
                  src={props.imgsrc}
                  className="image-fluid animated img"
                  alt="CommonParent img"
                />
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default CommonParent;
